function Card(props){
    const {name,species,gender,image} = props
    
    return(
        <div>
            <button>x</button>
            <h2>{name}</h2>
            <h2> {species}</h2>
            <h2>{gender}</h2>
            <img src={image} alt={image}/>
        </div>
    )
}

export default Card
